describe('materializer', () => {
    it('should work for big objects', () => {
        const materializer = createMaterializer({
            observedRoots: ['a0'],
            depth: 2
        })

        const invalidations = materializer.update(bigJson)

        expect(invalidations.length).toBe(3000)

        const expected = _.fromPairs(_.range(0, 10).map(i => [`prop${i}`, `value${i}`]))
        for (let i = 0; i < invalidations.length; i++) {
            expect(materializer.get(invalidations[i])).toEqual(expected)
        }
    })
})
